import React from "react";

export function ContactSection() {
  const sectionStyle = {
    backgroundColor: "#f7f7f7",
    color: "#061523",
    padding: "80px 16px",
    textAlign: "center",
  };

  const infoStyle = { marginBottom: "8px" };

  return (
    <section style={sectionStyle}>
      <h2 style={{ fontSize: "2rem", fontWeight: "bold", marginBottom: "24px" }}>
        Contact Us
      </h2>
      <p style={infoStyle}>123 Galle Road, Colombo 03, Sri Lanka</p>
      <p style={infoStyle}>+94 11 234 5678</p>
      <p style={infoStyle}>info@nettecelectronic.lk</p>
    </section>
  );
}
